import React, { Component } from 'react';
import styled from 'styled-component';

const AppContainer = styled.div`
  display: grid;
  grid-auto-flow: row;
`;

class App extends Component {
  render() {
    return (
      <AppContainer>
        <header className="App-header">
          <p>Personal goals</p>
        </header>
        <section>
          <p>There's no any goal yet. Please add the first one.</p>
        </section>
      </AppContainer>
    );
  }
}

export default App;
